// ==UserScript==
// @name         百度背景替换
// @namespace    baidu.com
// @version      0.1
// @description  【自用】百度首页的背景改成不刺眼的灰色
// @author       beike
// @match        https://www.baidu.com/*
// @icon         https://www.google.com/s2/favicons?sz=64&domain=baidu.com
// @grant        none
// @license      MIT
// @downloadURL https://update.greasyfork.org/scripts/486122/%E7%99%BE%E5%BA%A6%E8%83%8C%E6%99%AF%E6%9B%BF%E6%8D%A2.user.js
// @updateURL https://update.greasyfork.org/scripts/486122/%E7%99%BE%E5%BA%A6%E8%83%8C%E6%99%AF%E6%9B%BF%E6%8D%A2.meta.js
// ==/UserScript==

(function() {
    'use strict';
    // body
    const body = document.querySelector('body')
    body.style.background = '#efefef'
    // 顶部栏
    const topBar = document.querySelector('#s_top_wrap')
    if (topBar) {
        topBar.style.background = 'transparent'
    }
    const searchHead = document.querySelector('#head');
    if (searchHead) {
        searchHead.style.background = 'transparent'
    }
    // 观察器的配置（需要观察什么变动）
    const config = { attributes: true };
    // 当观察到变动时执行的回调函数
    const callback = function (mutationsList, observer) {
        for (let mutation of mutationsList) {
            if (mutation.type === 'attributes') {
                if (mutation.attributeName === 'style') {
                    searchHead.style.background = 'transparent'
                }
                // console.log('修改了属性', mutation);
            }
        }
    };
    // 创建一个观察器实例并传入回调函数
    const observer = new MutationObserver(callback);
    // 以上述配置开始观察目标节点
    observer.observe(searchHead, config);
    // 底部栏
    const bottom_layer = document.querySelector('#bottom_layer')
    if (bottom_layer) {
        bottom_layer.style.background = 'transparent'
    }
    // 默认图片
    const defBase64 = 'data:image/png;base64,'
    // 皮肤容器
    const skinContainer = document.querySelector('.s-skin-container.s-isindex-wrap.skin-gray-event')
    if (skinContainer) {
        skinContainer.style.background = `url(${defBase64}) no-repeat fixed bottom right`
    }
})();